import React, { useState, useEffect } from 'react';
import getBoard from '../Axios/BoardListAxios';

function BoardList() {

    const [title, setTitle] = useState([]);
    

    function callback(data, cont){
        setTitle(data);
        
    }

    useEffect(
        () => {
            getBoard(callback);
        }, []
    );
    return(
   <div>
       <h1>{title}</h1>
     
   </div>
    );
}

export default BoardList;
